import React from "react";

const FrmAgregar = () => {
  return (
    <>
      <div class="card" style={{ width: "18rem", textAlign: "center" }}>
        <div class="card-body">
          <h5 class="card-title">Agregar Pelicula</h5>
        </div>
      </div>
    </>
  );
};

export default FrmAgregar;
